import React from "react";
import "./Footer.css";
import * as fiIcons from "react-icons/fi";
import * as faIcons from "react-icons/fa";
const Footer = () => {
  const footerBackground = "./images/footer-background.svg";
  return (
    <footer className="footer-container">
      <img
        className="footer-img"
        src="./images/footer-white-background.svg"
        alt="background image"
      />
      <img
        className="footer-dash"
        src="./images/footer-background-dashes.svg"
        alt=""
      />
      <div className="footer-links">
      <a href="http://www.github.com/treigenborn" target="_blank" rel="noopener noreferrer">  <fiIcons.FiGithub className="footer-link" /> </a>
      <a href="http://www.linkedin.com/treigenborn" target="_blank" rel="noopener noreferrer">  <faIcons.FaLinkedinIn className="footer-link" /> </a>
       <a href="http://www.instagram.com/treigenborn" target="_blank" rel="noopener noreferrer"> <faIcons.FaInstagram className="footer-link" /> </a>
      </div>
    </footer>
  );
};

export default Footer;
